mem: .word 0 #TODO "alloc" memory
#9 = mem ptr ; 8 = ins ptr
.text
.global _start
_start:
la $s5,mem
la $s6,ins
bf_loop:
	LB $s2,0($s6)#load instruction to s2
	LB $s3,0($s5)#load mem value to s3
	
	beqz $s2,exit

	ADDI $s4,$0, '+'
	BEQ $s2,$s4, inc

	ADDI $s4,$0, '-'
	BEQ $s2,$s4, dec

	ADDI $s4,$0, '<'
	BEQ $s2,$s4, shl

	ADDI $s4,$0, '>'
	BEQ $s2,$s4, shr
	
	ADDI $1,$0, ','
	BEQ $s4,$s2, read
	
	ADDI $s4,$0, '.'
	BEQ $s4,$s2, write
	
	ADDI $s4,$0, '['
	BEQ $s2,$s4, lpa
	
	ADDI $s4,$0, ']'
	BEQ $s2,$s4, rpa
	
next_i: 
	ADDI $s6,$s6,1
	j bf_loop

inc:
	ADDI $s3,$s3, 1
	SB $s3,0($s5)
	j next_i

dec:
	ADDI $s3,$s3, -1
	SB $s3,0($s5)
	j next_i

shl:
	#SB $s3,0($s5)
	ADDI $s5,$s5, -1
	j next_i

shr:
	#SB $s3,0($s5)
	ADDI $s5,$s5, 1
	j next_i

lpa:#TODO use stack to avoid code iterations for right parethesis
	bnez $s3, next_i
	#else find the end of the loop
	#iterate instructions until final parethesis (instruction after)
	find_end:#not used for now	
		ADDI $t1,$0,'['
		ADDI $t2,$0,']'
		ADDI $t3,$0,0 #loop counter
		lpa_iterate: 
			ADDI $s6,$s6,1 # i_ptr ++
			lb $t4,0($s6)
			BNE $t4,$t1,else_1#if ins != '[': increment counter and next instruction
				ADDI $t3,$t3,1 #loop counter
				j lpa_iterate
			else_1:
				BNE $t4,$t2,lpa_iterate#if ins != ']': continue
					BEQ $t3,$0,next_i#end of loop found next instruction
					ADDI $t3,$t3,-1 #loop counter
					j lpa_iterate
rpa:
	beq $s3,$0,next_i #if mem==0 : next instruction (the first after the loop)
	#else find the begin of the loop
	#iterate instructions until initial parethesis (instruction after, the first of the loop)
	ADDI $t1,$0,']'
	ADDI $t2,$0,'['
	ADDI $t3,$0,0 #loop counter
	rpa_iterate: 
		ADDI $s6,$s6,-1 # i_ptr ---
		lb $t4,0($s6)
		BNE $t4,$t1,else_2#if ins != '[': increment counter and next instruction
			ADDI $t3,$t3,1 #loop counter
			j rpa_iterate
		else_2:
			BNE $t4,$t2,rpa_iterate#if ins != ']': continue
				BEQ $t3,$0,next_i#end of loop found next instruction
				ADDI $t3,$t3,-1 #loop counter
				j rpa_iterate
write:
	addi $a0,$s3,0
	addi $v0,$0,11 # print char
	syscall 
	j next_i
read:	
	addi $v0,$0,12 # read char
	syscall 
	sb $v0, 0($s5)
	j next_i

exit: j exit
